6月3日(土)19:00〜21:00
六本木の大人空間、BAR BOOZERを貸し切った特別な夜のイベント❤️
ドレスコードは、東京の夜🗼をイメージした、パーティ感のある服で、オシャレして来て下さいね💋

charge:1D/2000
Access:六本木BAR BOOZER
東京都港区六本木5丁目16-4
エーワンビル地下1階
※コンビニの地下辺りです。

いろんな業種の方が集まるので、出会いの場になれば幸いです😍❤️
パーティ感のある写真も撮れたら嬉しいなー📸💓✨
当日は、来場者限定の素敵なお知らせが！✨高級エステが無料になる！？💆✨新作の洋服が割引価格で買える！？👚✨などのお得な情報も💓
お楽しみに☺️💓 音楽もあるのでノリノリ楽しみましょー🎶🎉✨基本女子限定ですが、だぁりんや兄弟、ウェルカムです😆💓私の弟はプロのカメラマンとして、だぁりんはDJとしても参加してもらいます✨

GLANCEは、一目見ただけでときめいたり、素敵だなって感じるその感覚や、空間を共有できるイベントにしたくて、名付けました❤️
